import React, { Component } from "react";
import Title from "./Title";
import LeftBar from "./LeftBar";
 import Example from "./Example";
import Description from "./Description";
import DescriptionCustomer from "./DescriptionCustomer";
import DynamicTable from './DynamicTable';
import CustomerList from './CustomerList'
import CardsList from './CardsList'
import AssetList from './AssetList'
import SnowFlakeList from './SnowFlakeList'
import RollingWindow from "./RollingWindow";
// import TableColumn from "./TableColumn";
import { Route } from "react-router-dom";

class Main extends Component {

  render() {
 
    return (
      <div style={{ backgroundColor: "white" }}>
        <Route
          exact
          path="/"
          render={() => (
            <div>
              <Title title={"FULCRUM"} Icon="f50b"/>
              
              <LeftBar />
            </div>
          )}
        />

        {/* <Route
          path="/AddTransform"
          render={() => (
            <div>
              <Example />
            </div>
          )}
        /> */}

<Route
          path="/AddTransform"
          render={() => (
            <div>
              <Description />
              {/* <DescriptionCustomer /> */}
            </div>
          )}
        />
        <Route
          path="/CustomerListScreen"
          render={() => (
            <div>
              <CustomerList />
              {/* <DescriptionCustomer /> */}
            </div>
          )}
        />
         <Route
          path="/CardsListScreen"
          render={() => (
            <div>
              <CardsList />
              {/* <DescriptionCustomer /> */}
            </div>
          )}
        />
        <Route
          path="/AssetListScreen"
          render={() => (
            <div>
              <AssetList />
              {/* <DescriptionCustomer /> */}
            </div>
          )}
        />
        <Route
          path="/SnowFlakeListScreen"
          render={() => (
            <div>
              <SnowFlakeList />
              {/* <DescriptionCustomer /> */}
            </div>
          )}
        />
        <Route
          path="/AddOverviewScreen"
          render={() => (
            <div>
              <DescriptionCustomer />
            </div>
          )}
        />
  <Route
          path="/AddWorkbench"
          component={Example}
          // render={() => (
          //   <div>
          //     <Example/>
          //   </div>
          // )}
        />  

<Route
          path="/saveTransaction"
          component={DynamicTable}
          // render={() => (
          //   <div>
          //     <DynamicTable />
          //   </div>
          // )}
        />

<Route
          path="/Financial"
          component={Example}
          // render={() => (
          //   <div>
          //     <Example />
          //   </div>
          // )}
        />

<Route
          path="/BackDashboard"
          render={() => (
            <div>
                 <Title title={"FULCRUM"} />
               <LeftBar />
            </div>
          )}
        />

        
<Route
          path="/DailyTransaction"
          render={() => (
            <div>
                    <Title title={"FULCRUM"} />
              <LeftBar />
            </div>
          )}
        />
         <Route
          path="/RollingWindow"
          component={RollingWindow}
          // render={() => (
          //   <div>
          //     <Example/>
          //   </div>
          // )}
        />  
        
      </div>
    );
  }
}

export default Main;
